import { useEffect } from "react"
import { useParams } from "react-router-dom"

function View(){
    const params1=useParams()
    useEffect(()=>{
        fetch(`http://localhost:9000/prodact/${params1.prodactId}`)
        .then(res=>res.json())
        .then(data=>setData(data))
    })
    return(
        <h1>the proadct id is  {params1.prodactId}</h1>
    )
}
export default View
